(36420, '9BE8125F-1D3C-4027-8F73-3229D40264BE', 'I’m sorry that I was not truthful to you and minimized my communications with Ilse when you asked me. There was not one message, but 3 messages at 3:16, 3:21, and 4:18. You are right that when I was put on the spot by you that I felt scared and embarrassed and defensive. I don’t know why I said one message when there were three….while telling you that I did interact….especially when we didn’t have clear agreements here. I recognized it when you called it…. that probably would have been better not to check my messages while we were at the museum. I know that this is not the point. Thank you for reflecting back to me an area where I need to shine some light and do some additional work….which I am prioritizing.', 'David', 'Nitzan', '2021-10-27T12:54:38.352000'),
(36421, '91BC74EB-79A8-4721-9425-2C55A408ED5C', 'I’m working through my feelings/thoughts about your relationship with Ken as well. They way you got here doesn’t sit well with me. I recognize that much of this is my stuff….and not you. So I need help to process so that I/we don’t revert to old patterns. I’m taking as a growth opportunity for me. I hope that you will do the same. You are no longer a neutral party in his relationship.', 'David', 'Nitzan', '2021-10-27T13:04:00.276000'),
(36423, '43BB28F5-856C-4314-A0B5-B8886BEBAA9F', 'I️ love you so very much and appreciate your accountability ', 'Nitzan', 'David', '2021-10-27T13:15:50.463981'),
