(36431, '0D27F7A6-0011-432F-B6DE-8530961D6C96', 'Hi Nitzan!  I remember laying in bed at 1am on a chilly Friday night back in February, feeling hopeless, scrolling through an endless maze of job opportunities. At the time, I was working part-time for an amazing nonprofit, but I was not making enough to get by. I’d recently found out about Salesforce Administration, but had been reading that breaking into the field was incredibly difficult. Then all of sudden, I saw this ad for a program called Climb Hire: a program geared toward getting overlooked talent into tech. It was at that moment that I felt hope for the first time since Covid 19 lockdowns had started - somehow, this program seemed right. One that would proudly take in those who had struggled in life - immigrants, those with learning disabilities (like me!), people of color.   I filled out the initial application. I remember a question asking why I wanted to do this. I answered: This program would change my life.   It did.   Recently, I was hired to be one of two founding members for the Salesforce team at Ed-Tech startup, Morressier. This position pays more than double any other job I''ve ever had. But this change isn’t the one that matters. Instead, it’s that now, I believe in myself. I have confidence in myself as a professional and as a leader. A year ago, I wondered if I had a future at all, now I’m asking myself just how bright it can be.   The best part has been watching those I’ve grown to care so much about grow alongside myself. Nowhere is there a community more supportive than that of Climb Hire. These Climbers and staff are all incredible, and seeing where they all go as they too learn to believe in themselves will be amazing.   Thank you for creating this program. It really does change lives.', 'Nitzan', 'David', '2021-10-27T13:49:08.756923'),
(36432, 'B66A1052-0177-40AF-9DA4-E4251DC1F66D', 'When we were in bed this morning and you grabbed me and told me you were feeling horny, a voice in my head asked the question “is it horny for me, or Ken?” I have my own tender spots still. When I was on top of you last night and we were talking and I said “let’s have Ken and Ilse wait outside our room.” One minute later….you started on a topic about Ken again. If I ask for the “others” to leave the room, could you please  tell me if there is something else you want to discuss before we shut the door and then honor our space alone? You may remember that you first told me about you having sex with Garrett when I was in the same position….so it is a vulnerable place for me. It is important to me that we can create our own container….without distraction and other people in our bed room….like it is for you that I’m not distracted by phones during family and us time.', 'David', 'Nitzan', '2021-10-27T13:53:58.940000'),
(36433, '69005389-E1C6-4E5D-9EEA-D5EDB8B5E675', 'I️ hear you and understand. I’m also sad that you were questioning whether I️ was horny for you. I️ wouldn’t have told you I️ was horny for you if I️ was horny for someone else. That’s not really my style.', 'Nitzan', 'David', '2021-10-27T13:57:59.171766'),
